import { Link, withRouter } from 'react-router-dom';
//withRouter gives the app the props
class SongList extends React.Component{
  // state = {
  //    currentAudio: null
  // }

 // handleSelectedAudio =(audio)=>{
 //   this.setState({
 //     currentAudio: audio
 //   })
 // }

  renderTracks = () => {
      const newArr = this.state.trackList.map(track => {
        return <SongCard key={track.id} track={track} selectedTrackCard={this.props.selectedTrackCard} currentPlaylist={this.state.currentPlaylist}/>
      })
      return newArr
  }



  render(){
    console.log("SongList props", this.props);
    return(
      <div>
      <h1>Song List</h1>
      {this.renderTracks()}
      </div>
    )
  }
}

export default withRouter(SongList);
